        <div class="reveal">
            <div class="slides"><section  data-markdown><script type="text/template"><p align="center" style="font-size: 60px">身份与话语表达</p>
<p align="center" style="font-size: 45px">第三级议程设置视角下的反腐议题</p>
<br>
<br>
<p align="center" style="font-size: 28px">新闻与传播学院</p>
<p align="center" style="font-size: 24px">罗晨</p></script></section><section  data-markdown><script type="text/template">##### Realistic Basis
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Anti-corruption as an obtrusive issue which had been heavily publicized by media and stimulated lots of discussion</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Knowledges of malversation and anti-corruption processes usually come from authoritative institutions</p>
<p align="left" style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Social media platforms act as agoras and ensure mutual interchange of opinions (Castells, 2008; Freeman, 2017; Kitchin, 1998), common people can participate in anti-corruption process, social media helps the formation of social mobilization mechanism (Best & Krueger, 2005; Lee & Lio, 2016; Vitak et al., 2011)</p></script></section><section  data-markdown><script type="text/template">##### Theoretical Justification: Network Agenda Setting
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">First level of agenda setting: The public considers attitude objects prioritized by the news as the most important (McCombs & Shaw, 1972)</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Second level of agenda setting: Media’s influence on how individuals perceive different aspects of attitude objects (McCombs et al., 1997)</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Third level of agenda setting (Network Agenda Setting): The salience of media networks of attitude objects and attributes influences the salience of the networks of these elements among the public (Guo & McCombs, 2011, 2016)</p></script></section><section  data-markdown><script type="text/template">##### Theoretical Justification: Network Agenda Setting
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">The former two phases of agenda setting: linear, discrete</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">The Network Agenda Setting: networked, integrated</p>

<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Initial data volume: 77482 — Delete crawler disorder: 77203 — Eliminate semantic disambiguation: 77807 — Remove short length based on length distribution: 72515 — Screen non-original content: 50124</p>

<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Four coders conducted open coding based on 2000 microblogs randomly selected (develop custom dictionary and stop-word list)</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Extract 10 principal attributes in group discussion</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Most words in coding table are nouns — conducted word segmentation and extracted nouns from corpus  — allocated high frequency nouns into existing attributes + Violation Reasons from Caixin news corpus + Offenders’ information before the 19th National Congress of CPC</p>

<img src="https://lyndonlc.github.io/specialIssue/identityAndCorruption/img/QAPCorrelation.png" alt=""/></script></section><section  data-markdown><script type="text/template"><p align='left' style="font-size: 35px; text-align: justify; margin-bottom: 1.5em">Variable Smoothness Test</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Employ EViews 10.0</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Calculate each attribute’s eigenvector centrality of each identity in each day</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Time lag: how long an issue will remain salient in people’s minds, demonstrates time-varying causal effects</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Traditional media: 4-6 weeks (Winter & Eyal, 1981), 2-6 months (Stone & McCombs, 1981), 3-4 months (Shoemaker, Wanta, & Leggett, 1989)</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Online media: 1-7 days (Roberts, Wanta, & Dzwo, 2002), 1-5 days (Vargo & Guo, 2017)</p></script></section><section  data-markdown><script type="text/template"><img src="https://lyndonlc.github.io/specialIssue/identityAndCorruption/img/ADFResults.png" height="600" alt=""></script></section><section  data-markdown><script type="text/template"><p align='left' style="font-size: 35px; text-align: justify; margin-bottom: 1.5em">Granger Causality Test</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Most of the attributes lag 0-order, and there is no Granger causality between the agendas of different identities</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">For attr5 (“反腐效力”), when lag = 6,</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">blueV is the Granger cause of common (Chi-square=18.767, p<0.01)</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">yellowV is the Granger cause of common (Chi-square=17.735, p<0.01)</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">blueV is the Granger cause of yellowV (Chi-square=13.804, p<0.05)</p></script></section><section  data-markdown><script type="text/template"><p align='left' style="font-size: 35px; text-align: justify; margin-bottom: 1.5em">Granger Causality Test</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">For attr7 (“文艺作品”), when lag=3,</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">yellowV is the Granger cause of blueV (Chi-square=8.858, p<0.05)</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">blueV is the Granger cause of common (Chi-square=7.960, p<0.05)</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">blueV is the Granger cause of yellowV (Chi-square=7.841, p<0.05)</p>
<br>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">For attr8 (“援引史料”), when lag=3,</p>
<p align='left' style="font-size: 22px; text-align: justify; margin-bottom: 1.5em; text-indent: 60px">common is the Granger cause of yellowV (Chi-square=6.717, p<0.1)</p></script></section><section  data-markdown><script type="text/template">##### Limitations
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Extend the span of data collection (1 year or several years)</p> 
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Combine the topic modeling results with attribute category</p>
<p align='left' style="font-size: 28px; text-align: justify; margin-bottom: 1.5em">Use impulse response analysis to reveal the effect tendency and response function, incorporate the variance decomposition analysis to get the effect of particular variable</p></script></section></div>

              for (var i = 0; i < arguments.length; i++) {
                var source = arguments[i];
                for (var key in source) {
                  if (source.hasOwnProperty(key)) {
                    target[key] = source[key];
                  }
                }
              }
              return target;
            }

            // Optional libraries used to extend on reveal.js
            var deps = [
              { src: './lib/js/classList.js', condition: function() { return !document.body.classList; } },
              { src: './plugin/markdown/marked.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },
              { src: './plugin/markdown/markdown.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },
              { src: './plugin/highlight/highlight.js', async: true, callback: function() { hljs.initHighlightingOnLoad(); } },
              { src: './plugin/zoom-js/zoom.js', async: true },
              { src: './plugin/notes/notes.js', async: true },
              { src: './plugin/math/math.js', async: true }
            ];

            // default options to init reveal.js
            var defaultOptions = {
              controls: true,
              progress: true,
              history: true,
              center: true,
              transition: 'default', // none/fade/slide/convex/concave/zoom
              dependencies: deps
            };

            // options from URL query string
            var queryOptions = Reveal.getQueryHash() || {};

            var options = {};
            options = extend(defaultOptions, options, queryOptions);
        </script>


        <script>
          Reveal.initialize(options);
        </script>
    </body>
